webpackJsonp([0x648870441c75],{1588:function(a,e){a.exports={data:{markdownRemark:{html:'<p>사전 발행인은 "Ci Hai"가 정치 과학의 추가 항목을 수정하고 신속하게 초기 입력을 컴퓨터에 넣고 보내도록 촉구합니다. 사전은 대성공 이었지만 열심히 일하는 사람은 많지 않습니다. 최근에는이 분야에서 많은 소송이 있었으며, 많은 사람들이 서면으로 편집자가 그들을 통제 할 수 없으며, 다음 사람들은 어디에서나 복사 할 수 있으며 일부는 가위로 복사합니다. 사전을 작성할 때는 특히주의하십시오. 여기에는 도덕성이 있으며 학문적 도덕입니다.</p>\n<p>일본 국제 포럼은 팩스를 보내 달의 첫날에 일본에 가서 중국의 발전과 아시아의 안보에 관한 연설을하기로 결정했습니다. 일본 국제 포럼은 정책 자문기구로서, 보내진 자료에 따르면 어떤 영향력을 가지며 민간 단체로 보입니다. 일본에 외교 정책에 대해 조언하십시오. 그들은 유럽과의 관계 강화, 중국의 발전과 일본에 대한 전망, 미국, 러시아, 일본 간의 3 자간 관계 발전 등 몇 가지 정책 보고서를 보냈다. 일본의 연구 기관은 미국의 실천을 발전시키고 모방한다고 말 해져야한다. 그러나 일본에는 독자적인 특성이 있으며 대규모 연구 기관은 대기업의 지원을받으며 순수하고 독립적 인 연구 기관은 많지 않습니다. 대기업의 연구 기관은 매우 강력하고 풍부한 자금을 보유하고 있으며 지능도 민감합니다. 그들은 모든 나라에 사무소를두고 있습니다. 때때로 지능은 외무부보다 더 민감합니다. 일종의 의식이 작용할 수 있습니다. 일본인은 언제나 외국의 공격력을 두려워하고 있습니다. 섬나라는 특히 다른 나라에서 일어나는 일에 특별한 관심을 갖고 있으며 그 영향력 자체가 어떤 영향을 미치는지를 느낍니다. 그리고 토지 기반의 일부 권한은 그것에 대해별로 신경 쓰지 않는 것 같습니다. 어쨌든, 나는 나에 대해 아무 것도 할 수 없습니다. 나는 사업을하고 있습니다.</p>\n<p>밤 11시에 휘발유 티켓을 팔 던 사람들 만 여전히 열심히 일하고 있습니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0035.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0035.md",frontmatter:{title:"2월 18일 금요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0035.md absPath of file >>> MarkdownRemark"}}}});
